function App() {
  return (
<div className="relative min-h-screen inset-0 overflow-hidden h-screen w-  items-center px-5 py-24 [background:linear-gradient(125deg,#005276,#38ef7d)]">

    {/* <div class="absolute inset-0 -z-10 h-full w-full items-center px-5 py-24 [background:radial-gradient(125%_125%_at_50%_10%,#005276_40%,#38ef7d_100%)]"> */}
 <Router>
 <Routes>
